import React from 'react';
import Button from '@material-ui/core/Button';

function ExportCsv() {

  const exportCsvFile =()=>{

    console.log("Hello")
    var url = `http://localhost:4000/api/v1/export_csv?company_name=Protonshub Technologies&url=https://www.linkedin.com/company/protonshub-technologies`;
    var anchor = document.createElement("a");
    anchor.setAttribute("href", url);
  anchor.setAttribute("download", "file.csv");
  anchor.click();


  }

  return (
    <div classname="App">
      <h5>Export data to CSV in React:-
      <Button variant="contained" onClick={exportCsvFile}> Export </Button>
      </h5>

    </div>
  );
}

export default ExportCsv;
